// adapted from
// https://github.com/yiwenl/Alfrid/blob/master/src/alfrid/loaders/ObjLoader.js
// Loads .obj files
class ObjLoader {
    path:string;
    constructor(path:string = ""){

        this.path = path;

    }

    /**
     * Loads an model based on it's string form
     * @param path {string} the model string.
     */
    loadModel(path:string=""){
        path = path !== "" ? path : this.path;

        if(path !== ""){

            return ObjLoader.parse(path);
        }
    }

    /**
     * Loads an .obj file from a url
     * @param path {string} the path to the model.
     */
    loadModelFromUrl(path:string = ""){
        path = path !== "" ? path : this.path;

        if(path !== ""){

            return new Promise((res,rej) => {

                fetch(path).then(res => {
                    return res.text();
                }).then(data => {
                    let _model = ObjLoader.parse(data);
                    res(_model);
                }).catch(e => {
                    rej(e);
                })

            })
        }
    }

    static parse(objStr) {
        const lines = objStr.split('\n');

        const positions    = [];
        const coords       = [];
        const finalNormals = [];
        const vertices     = [];
        const normals      = [];
        const uvs          = [];
        const indices      = [];
        let count        = 0;
        let result;

        // v float float float
        const vertexPattern = /v( +[\d|\.|\+|\-|e|E]+)( +[\d|\.|\+|\-|e|E]+)( +[\d|\.|\+|\-|e|E]+)/;

        // vn float float float
        const normalPattern = /vn( +[\d|\.|\+|\-|e|E]+)( +[\d|\.|\+|\-|e|E]+)( +[\d|\.|\+|\-|e|E]+)/;

        // vt float float
        const uvPattern = /vt( +[\d|\.|\+|\-|e|E]+)( +[\d|\.|\+|\-|e|E]+)/;

        // f vertex vertex vertex ...
        const facePattern1 = /f( +-?\d+)( +-?\d+)( +-?\d+)( +-?\d+)?/;

        // f vertex/uv vertex/uv vertex/uv ...
        const facePattern2 = /f( +(-?\d+)\/(-?\d+))( +(-?\d+)\/(-?\d+))( +(-?\d+)\/(-?\d+))( +(-?\d+)\/(-?\d+))?/;

        // f vertex/uv/normal vertex/uv/normal vertex/uv/normal ...
        const facePattern3 = /f( +(-?\d+)\/(-?\d+)\/(-?\d+))( +(-?\d+)\/(-?\d+)\/(-?\d+))( +(-?\d+)\/(-?\d+)\/(-?\d+))( +(-?\d+)\/(-?\d+)\/(-?\d+))?/;

        // f vertex//normal vertex//normal vertex//normal ...
        const facePattern4 = /f( +(-?\d+)\/\/(-?\d+))( +(-?\d+)\/\/(-?\d+))( +(-?\d+)\/\/(-?\d+))( +(-?\d+)\/\/(-?\d+))?/;


        function parseVertexIndex(value) {
            const index = parseInt(value);
            return (index >= 0 ? index - 1 : index + vertices.length / 3) * 3;
        }

        function parseNormalIndex(value) {
            const index = parseInt(value);
            return (index >= 0 ? index - 1 : index + normals.length / 3) * 3;
        }

        function parseUVIndex(value) {
            const index = parseInt(value);
            return (index >= 0 ? index - 1 : index + uvs.length / 2) * 2;
        }


        function addVertex(a, b, c) {
            positions.push([vertices[a], vertices[a + 1], vertices[a + 2]]);
            positions.push([vertices[b], vertices[b + 1], vertices[b + 2]]);
            positions.push([vertices[c], vertices[c + 1], vertices[c + 2]]);

            indices.push(count * 3 + 0);
            indices.push(count * 3 + 1);
            indices.push(count * 3 + 2);

            count ++;
        }


        function addUV(a, b, c) {
            coords.push([uvs[a], uvs[a + 1]]);
            coords.push([uvs[b], uvs[b + 1]]);
            coords.push([uvs[c], uvs[c + 1]]);
        }


        function addNormal(a, b, c) {
            finalNormals.push([normals[a], normals[a + 1], normals[a + 2]]);
            finalNormals.push([normals[b], normals[b + 1], normals[b + 2]]);
            finalNormals.push([normals[c], normals[c + 1], normals[c + 2]]);
        }

        function addFace(a, b, c, d,  ua?, ub?, uc?, ud?,  na?, nb?, nc?, nd?) {
            let ia = parseVertexIndex(a);
            let ib = parseVertexIndex(b);
            let ic = parseVertexIndex(c);
            let id;

            if (d === undefined) {

                addVertex(ia, ib, ic);

            } else {

                id = parseVertexIndex(d);

                addVertex(ia, ib, id);
                addVertex(ib, ic, id);

            }


            if (ua !== undefined) {

                ia = parseUVIndex(ua);
                ib = parseUVIndex(ub);
                ic = parseUVIndex(uc);

                if (d === undefined) {

                    addUV(ia, ib, ic);

                } else {

                    id = parseUVIndex(ud);

                    addUV(ia, ib, id);
                    addUV(ib, ic, id);

                }

            }

            if (na !== undefined) {

                ia = parseNormalIndex(na);
                ib = parseNormalIndex(nb);
                ic = parseNormalIndex(nc);

                if (d === undefined) {

                    addNormal(ia, ib, ic);

                } else {

                    id = parseNormalIndex(nd);

                    addNormal(ia, ib, id);
                    addNormal(ib, ic, id);

                }

            }
        }


        for (let i = 0; i < lines.length; i ++) {
            let line = lines[i];
            line = line.trim();

            if (line.length === 0 || line.charAt(0) === '#') {

                continue;

            } else if ((result = vertexPattern.exec(line)) !== null) {

                vertices.push(
                    parseFloat(result[1]),
                    parseFloat(result[2]),
                    parseFloat(result[3])
                );

            } else if ((result = normalPattern.exec(line)) !== null) {

                normals.push(
                    parseFloat(result[1]),
                    parseFloat(result[2]),
                    parseFloat(result[3])
                );

            } else if ((result = uvPattern.exec(line)) !== null) {

                uvs.push(
                    parseFloat(result[1]),
                    parseFloat(result[2])
                );

            } else if ((result = facePattern1.exec(line)) !== null) {

                addFace(
                    result[1], result[2], result[3], result[4]
                );

            } else if ((result = facePattern2.exec(line)) !== null) {

                addFace(
                    result[2], result[5], result[8], result[11],
                    result[3], result[6], result[9], result[12]
                );

            } else if ((result = facePattern3.exec(line)) !== null) {
                addFace(
                    result[2], result[6], result[10], result[14],
                    result[3], result[7], result[11], result[15],
                    result[4], result[8], result[12], result[16]
                );

            } else if ((result = facePattern4.exec(line)) !== null) {
                addFace(
                    result[2], result[5], result[8], result[11],
                    undefined, undefined, undefined, undefined,
                    result[3], result[6], result[9], result[12]
                );

            }
        }

        return {
            positions:positions,
            coords:coords,
            normals:finalNormals,
            indices:indices
        }

    }

}

export default ObjLoader;
